import React from 'react';

//const results = [{name, flag, capital, continent, poblation}];

const Country = (props) => {
    const {characters} = props
     
    return (
        <div>
            {characters.map((char) => (
                <div key={char.id}>
                    <h3>{char.name}</h3>
                    <img src={char.flag} alt="Not found" />
                    <div>
                        <h5>Capital: {result.capital}</h5>
                        <h5>Continent: {result.continent}</h5>
                        <h5>Population: {result.population}</h5>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default Country;
